import './Expenses.css'

import Card from '../UI/Card';
import ExpenseItem from "./ExpenseItem";

const Expenses = (itemProps) => {    
    return (
        <Card className="expenses">
            {/*"itemProps.items" replaces declaring a "const expenses = itemProps.items"*/}
            {itemProps.items.map((expense, index) => (
                <ExpenseItem
                    key={index}
                    title={expense.title}
                    price={expense.price}
                    date={expense.date}
                />
            ))}
        </Card>
    )
}

export default Expenses
